~01~prompt~panel_022.(hero_NOT_elthiarLike)~4_hero=Translation error: <hero2.bookish/coward/hothead/loner/poet/60:Are those the two outcomes? \nHow comforting.<hero.coward/goofball/greedy/healer/hothead/leader/romantic/80:[face:interested] [small]How very.../[face:happy]/[face:dubious]/[face:happy]/[face:joke]/[face:happy]/[face:grim]/>/[hero2.face:interested]<hero.coward/goofball/greedy/hothead/loner/snark/80:[face:interested]Yeah? Yeah, I'm... or I'll... yeah. Me [i]too.[]/[face:happy]We should get tattoos after this./[face:skeptical]Yeah? You don't sound too convinced./[face:happy]It's [i]exciting,[] right?/[face:neutral]You don't have to say that./[face:neutral]Ah, good. We're both [i]brimming[] with confidence./[face:neutral]I think we'll be looking out for each [i]other.[] Hm?>/[hero2.face:grim]<hero.coward/goofball/greedy/healer/hothead/leader/poet/80:[face:interested]I guess just as... long as it takes? [small]Which is... yeah./I'm learning you actually [i]do[] get nervous.\nIt's kind of endearing.[face:happy]/[face:skeptical]Long enough to be worth it, hopefully?/[face:talking]Can't fight battles that haven't begun.\n/[face:skeptical][i]You're[] worried? Hey, what's going to be fiercer than the two of us [i]together,[] hm?/[face:talking]I have plenty of faith in you, <hero2>. And in my own <hero.whm:arms, this body of mine./legs, my precision, my knife./acuity, my spellcraft.> We're as ready as we can be. So... let's not tire ourselves out, is all I mean./[face:neutral]I think of the fable. Bear spends all night fighting imaginary battles with <hero2.mf:his/her/her> challenger, Wolf. When day comes, <hero2.mf:he's/she's/she's> too tired. <hero2.mf:He/She/She> loses./Yeah. As long as it takes, I guess.<hero.romantic.80:[face:happy]/[face:neutral]>>/<hero2.loner.80:Yeah, I think that's... [i]sort[] of the line.[face:skeptical]/[face:skeptical]I don't know, either. Take it day by d... or whatever. Whatever we get down here. [small][i]Days?[] Guess I'll have to ask.><hero.coward/goofball/healer/leader/loner/poet/romantic/80:[face:interested]/[face:happy]/[face:happy]/[face:happy]/[face:grim]/[face:neutral]/[face:interested]/>/<hero.bookish/coward/healer/leader/poet/romantic/80:[face:skeptical]Though I'm of the same mind as you... may I point out, or are you aware... that our inability to [i]predict[] it has no bearing on whether any of it will be [i]nice?[]/[face:interested]You're excited now? Now that you've seen it? /[face:happy]You're letting your excitement show./[face:neutral]I respect what you're saying. But it... well. I guess you're more excited for this than I thought./[face:neutral]Everyone says you're a writer./[face:happy]You're a little excited now, aren't you? See?/[face:neutral]So you're quoting [i]yourself[] to me.>/<hero2.goofball/greedy/healer/leader/romantic/snark:Try [i]not[] to go nuts, though. <hero.greedy/healer/hothead/leader/loner/poet/snark/80:[face:skeptical]Seriously. I'm counting on you to keep me in one piece./Alright? [face:happy]If you can help it?/[face:dubious]Seriously. There's half a chance I'll give up on you, if you get too annoying.../\nAlright? [face:happy]If you can help it?/[face:neutral]/[face:neutral]It'd be a shame./[face:talking]Right?\nAt least put it [i]off?[]/Yeah?>[hero2.face:joy]/<hero.goofball/greedy/hothead/loner/snark/60:/I mean... sure. I don't want that either.[face:skeptical]/[face:grim]I'm not about to roll over and die. But [i]sure.[]/[face:neutral]I can listen alright./[face:neutral]Yeah. I mean... me neither?/Alright, yeah. I'll be attentive.>/<hero.coward/goofball/greedy/healer/hothead/leader/60:[i]You[] weigh [i]me[] down? I... that seems improbable?/[face:happy]Sure, if you get moody, I'll do something cute./[face:skeptical]Uh. Sure. I'll let you know./[face:neutral]Your consideration is an example I rely on.\nSo. Same goes to you. Tell me if I'm... yeah./[face:talking]Sure, I can bark at you, I'm good at that./[face:neutral]That's bravely said. I'll try to deserve your honesty./Yeah. I mean, hopefully it doesn't come to that. I'm not sure I'd even pick up on... well. Hm.[face:neutral]>/<hero.coward/goofball/hothead/loner/snark/80:[face:interested]Partners? Yeah. I... yeah, I'm... pretty sure. \nAnd I mean, definitely [i]tell[] me if... yeah./[face:happy]I'm going to be [i]your[] hero by the time we're done!/[face:skeptical]What [i]I'm[] hearing is we weren't on the same level \n[i]before.[] So if you're saying you need me to prove \nI can handle all this... I definitely [i]will./[face:neutral]I understand what you're saying. Faith and all that. I won't just blindly follow you, either, though./Honestly...? That's reasonable. I don't have anything sarcastic to say. I'll try not to get us killed?/[face:neutral]I'll be learning as I go. So... just know you'll probably still have to teach me a little bit. But I'm [i]ready.[]>/[face:neutral]<hero.bookish/coward/healer/leader/poet/romantic/60:Reminds me of the Desolation \npassages from 'Opal Knight.'/[face:interested]I... can we [i]hope...[] [small]that it's not entirely miserable?/[face:neutral]It's good to say out loud, isn't it?\nThere's still a lot to understand./It's good to say out loud, isn't it?\nBut there's a lot ahead of us, still./It's very dark. Almost feels [i]clouded[] with misery./[face:interested]I know what you mean. It's pretty magical, isn't it? Really [i]feels[] like we've stepped into the land of misery./That's a lot you can't help but express.<hero.hothead/loner/60:[face:dubious]/[face:neutral]/[face:skeptical]>>/[face:skeptical]>> --> Text length need to be between 0 and 5000 characters
